import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import SwipeableDrawer from '@material-ui/core/SwipeableDrawer';


function Drawer() {

    return (
        <>
            <IconButton
                edge="start"
                color="inherit"
                aria-label="open drawer"
                onClick={() => { }}
            >
                <MenuIcon />
            </IconButton>

            <SwipeableDrawer
            anchor="left"
            open={false}
            onClose={() => {}}
            onOpen={() => {}}
            >
            </SwipeableDrawer>
        </>
    );
}


export default Drawer;
